import Link from 'next/link';
import styled from 'styled-components';

const linkStyle = {
    marginRight: 15
  };

  const Title = styled.a`
    font-size: 1.5em;
    text-align: center;
    color: palevioletred;
  `;
  
  const Header = () => (
    <div>
      <h1>lkjljkkjl</h1>
      <Link href="/">
        <a className={Title}>Latest posts</a>
      </Link>
      <Link href="/new">
        <a style={linkStyle}>New post</a>
      </Link>
    </div>
  );
  
  export default Header;
